!function(){try{if(!window.Jotly)return;new PerformanceObserver(t=>{for(const e of t.getEntries())if(e.name.includes("/cart/add")){const t=localStorage.getItem("jotly_chart_viewed");if(t)try{const e=JSON.parse(t)[window.Jotly.productId];e&&window.Jotly.functions.trackEvent("add_to_cart",{chartId:e})}catch(t){}}}).observe({type:"resource",buffered:!0})}catch(t){console.error(t)}}();